import oracle.odi.domain.model.OdiDataStore
import oracle.odi.domain.mapping.exception.MappingException
import oracle.odi.km.exception.OdiKMException

public class LKM_File_to_ADWC_External_Table extends LKM_Object_Storage_to_ADWC_External_Table {

        protected String overwrite;
        protected String fileSchema;
        protected String objectStorageSchema;
        protected List<String> resourceList;
        protected boolean isObjectStorageStaging;
        protected boolean addCompression;
        protected String compressDirectory;
        protected String workDirectory;
        protected List<String> filesToCompress;
        protected List<String> compressedList;
        protected String compressionType;
        protected String keepSources;
        protected boolean keep;

        public void setBinding(Binding binding) {

            super.setBinding(binding);

            Map variables = binding.getVariables();

            overwrite = 'true';
            binding.setVariable("overwrite", overwrite);

            fileSchema = getSourceSchemaName();
            binding.setVariable("fileSchema", fileSchema);

            objectStorageSchema = getOptionValue("TEMP_OBJECT_STORAGE_SCHEMA");
            if (objectStorageSchema == null || objectStorageSchema == "") {
               throw new OdiKMException( "TEMP_OBJECT_STORAGE_SCHEMA option cannot be empty.");
            }
            binding.setVariable("objectStorageSchema", objectStorageSchema);

            resourceList = resourceName.split(',');
            binding.setVariable("resourceList", resourceList);

            objStoreUser = '<%=odiRef.getDataServerPropertyFromLSchema( "User Name", "' + objectStorageSchema + '")%>';
            binding.setVariable("objStoreUser", objStoreUser);

            swiftPwd = '<%=odiRef.getDataServerInfo("SRC_SWIFT_PASS", "' + objectStorageSchema + '")%>'
            binding.setVariable("swiftPwd", swiftPwd);

            sourceSchemaName = objectStorageSchema;
            binding.setVariable("sourceSchemaName", sourceSchemaName);

            binding.setVariable("isObjectStorageStaging", true);

            addCompression = (getOptionValue("ADD_COMPRESSION") == 'true')?true:false;
            binding.setVariable("addCompression", addCompression);

            if (addCompression) {
              def sourceDirectory = '<%=odiRef.getObjectName("L", "", "' + fileSchema + '", "D")%>';
              def sourceWorkDirectory = '<%=odiRef.getObjectName("L", "", "' + fileSchema + '", "W")%>';

              compressionType = getOptionValue("COMPRESSION_TYPE");
              binding.setVariable("compressionType", compressionType);

              keepSources = getOptionValue("KEEP_SOURCE_FILES");
              binding.setVariable("keepSources", keepSources);

              keep = (keepSources == 'true')?true:false;
              binding.setVariable("keep", keep);

              compressDirectory = sourceDirectory;
              binding.setVariable("compressDirectory", compressDirectory);

              workDirectory = sourceWorkDirectory;
              binding.setVariable("workDirectory", workDirectory);

              filesToCompress = resourceList;
              binding.setVariable("filesToCompress", filesToCompress);

              def suffix = ".bz2";
              if (compressionType.equals("gzip")) { suffix = ".gz" }

              compressedList = []
              resourceList.each {compressedList.add(it + suffix)}

              resourceName = compressedList.join(",");
              binding.setVariable("resourceName", resourceName);

              resourceList = compressedList;
              binding.setVariable("resourceList", resourceList);

              def option = physicalNode.getOptionValue(IKnowledgeModule.ProcessingType.SOURCE, 'COMPRESSION');
              option.setValue(compressionType)

              formatProperties = getFormatPropsList();
              binding.setVariable("formatProperties", formatProperties);
            }

        }
    }
